import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import Header from "components/Header/Header.jsx";
import HeaderLinks from "components/Header/HeaderLinks.jsx";
import Parallax from "components/Parallax/Parallax.jsx";
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import StepContent from '@material-ui/core/StepContent';

import landingPageStyle from "assets/jss/material-kit-react/views/landingPage.jsx";

// Sections for this page
import QuestionsSection from "./Sections/QuestionsSection.jsx";

const dashboardRoutes = [];


class QuestionsPage extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      step: 0,
    }
  }

//Procedd next step
nextStep = () => {
  const { step } = this.state;
  this.setState({ step: step + 1 });
} 

//Go back previous step
prevStep = () => {
  const { step } = this.state;
  this.setState({ step: step -1 });
} 

getSteps() {
  return ['Select campaign settings', 'Create an ad group', 'Create an ad'];
}

getActualSection = (step) => {
  switch (step) {
    case 0:
      return <QuestionsSection />
    case 1:
      return 'An ad group contains one or more ads which target a shared set of keywords.';
    case 2:
      return `Try out different ad text to see what brings in the most customers,
              and learn how to enhance your ads using features like ad extensions.
              If you run into any problems with your ads, find out how to tell if
              they're running and how to resolve approval issues.`;
    default:
      return 'Unknown step';
  }
}

  render() {
    const { classes, ...rest } = this.props;
    const { step } = this.state; 
    const steps = this.getSteps();



    return (
      <div>
        <Header
          color="transparent"
          routes={dashboardRoutes}
          brand="Memento"
          rightLinks={<HeaderLinks completed={true}/>}
          fixed
          changeColorOnScroll={{
            height: 400,
            color: "black"
          }}
          {...rest}
        />
         <Parallax filter small image={require("assets/img/hola.jpeg")}>
          <div className={classes.container}>
          </div>
        </Parallax>

        <div className={classNames(classes.main, classes.mainRaised)}>
          <div className={classes.container}>
            <QuestionsSection />
          </div>
        </div>
      </div>
    );
  }
}

QuestionsPage.propTypes = {
  classes: PropTypes.object
};

export default withStyles(landingPageStyle)(QuestionsPage);
